import React, { useEffect, useState } from "react";

const App = () => {
  const apiKey = "AIzaSyD_0oGw93lCcNaUkmdnEU780lDHOOnb-jI";
  const url = "https://www.googleapis.com/youtube/v3/search?key=";
  const [loading, setLoading] = useState(true);
  const [playlist, setPlaylist] = useState([]);

  useEffect(() => {
    fetch(`${url}${apiKey}`).then(response => response.json()).then(response => setPlaylist(response));
  }, []);
  return <div>{loading ? <h1>Loaidng...</h1> : null}</div>;
};

export default App;

